try
{
	string srcDocId = Get<string>("orderSrcDocID");
	string stateOm = Get<string>("orderStateOM");
	IOrderDataExternal orderDataExternal = ClassFactory.Get<IOrderDataExternal>();
	orderDataExternal.ReSetOrderStatus(srcDocId, stateOm, context.UserConnection);
}
catch(Exception ex)
{
	Insert insert = new Insert(context.UserConnection).Into("UsrExternalSystemsIntegrationOrderLog")
		.Set("UsrExecution", Column.Parameter(DateTime.Now))
		.Set("UsrService", Column.Parameter("UsrReSetOrderStatus.ReSetOrderStatusScriptTaskExecute.Exception"))
		.Set("UsrBody", Column.Parameter(ex.Message));
	insert.Execute();

	return false;
}

return true;
